CREATE TABLE `c_item` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(200) DEFAULT NULL COMMENT '商品标题',
  `shop` varchar(200) DEFAULT NULL COMMENT '店铺名称',
  `shop_id` int(11) DEFAULT NULL COMMENT '店铺id',
  `cprice` double DEFAULT NULL COMMENT '促销价格',
  `price` double DEFAULT NULL COMMENT '原始价格',
  `item_id` varchar(50) DEFAULT NULL COMMENT '商品ID',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='商品表';
